import React, { Component } from 'react';

import './App.css'
import LoginContainer from '../LoginContainer/LoginContainer';

class App extends Component {

  constructor(props){
      super(props);
      this.state = {
          authenticated: false
      }
  }

  render() {
        if(this.state.authenticated){
            return <div>Logged in!</div>
        }
        <LoginContainer />
  }
}

export default App;
